import React from 'react';
import './App.css';

function App() {
  state = {
    data: [
          {
            id: 'name',
            displayName: 'Name',
            type: 'textInput',
            display: true,
            isRequired: true
          },
          {
            id: 'gender',
            displayName: 'Gender',
            type: 'select',
            options: [
              {
                id: 1,
                name: 'Male',
                isDefault: true,
                sortOrder: 1
              },
              {
                id: 2,
                name: 'Female',
                isDefault: false,
                sortOrder: 2
              }
            ],
            display: true,
            isRequired: false
          },
          {
            id: 'weight',
            displayName: 'Weight',
            unitOfMeasure: 'kg',
            type: 'numberInput',
            bounds: {
              upperLimit: 1000,
            },
            display: true,
            isRequired: true
          }

        ]

    }

    return (
      <div className="App">

      </div>
    );
}

export default App;
